When a macro_rules! macro is invoked, the macro_rules! interpreter goes through the rules one by one, in declaration order. For each rule, it tries to match the contents of the input token tree against that rule's matcher. A matcher must match the entirety of the input to be considered a match. If the input matches the matcher, the invocation is replaced by the expansion; otherwise, the next rule is tried. If all rules fail to match, macro expansion fails with an error. The simplest example is of an empty matcher: macro_rules! four { () => { 1 + 3 };
} This matches if and only if the input is also empty ( i.e. four!(), four![] or four!{}). Note that the specific grouping tokens you use when you invoke the macro are not matched. That is, you can invoke the above macro as four![] and it will still match. Only the contents of the input token tree are considered. Matchers can also contain literal token trees, which must be matched exactly. This is done by simply writing the token trees normally. For example, to match the sequence 4 fn ['spang "whammo"] @_@, you would write: macro_rules! gibberish { (4 fn ['spang "whammo"] @_@) => {...};
} You can use any token tree that you can write.

