The statement fragment solely matches a statement without its trailing semicolon, unless its an item statement that requires one. What would be an item statement that requires one? A Unit-Struct would be a simple one, as defining one requires a trailing semicolon. Let's use a simple example to show exactly what is meant with this. We use a macro that merely emits what it captures: macro_rules! statements { ($($stmt:stmt)*) => ($($stmt)*);
} fn main() { statements! { struct Foo; fn foo() {} let zig = 3 let zig = 3; 3 3; if true {} else {} {} }
} Expanding this, via the playground for example [1] , gives us roughly the following: /* snip */ fn main() { struct Foo; fn foo() { } let zig = 3; let zig = 3; ; 3; 3; ; if true { } else { } { }
} From this we can tell a few things: The first you should be able to see immediately is that while the stmt fragment doesn't capture trailing semicolons, it still emits them when required, even if the statement is already followed by one. The simple reason for that is that semicolons on their own are already valid statements. So we are actually invoking our macro here with not 8 statements, but 11! Another thing you should be able to notice here is that the trailing semicolon of the struct Foo; item statement is being matched, otherwise we would've seen an extra one like in the other cases. This makes sense as we already said, that for item statements that require one, the trailing semicolon will be matched with. A last observation is that expressions get emitted back with a trailing semicolon, unless the expression solely consists of only a block expression or control flow expression. The fine details of what was just mentioned here can be looked up in the reference . See the debugging chapter for tips on how to do this.

