Usually, when working on a new macro, the first thing I do is decide what the macro invocation should look like. In this specific case, my first attempt looked like this: let fib = recurrence![a[n] = 0, 1, ..., a[n-1] + a[n-2]]; for e in fib.take(10) { println!("{}", e) } From that, we can take a stab at how the macro should be defined, even if we aren't sure of the actual expansion. This is useful because if you can't figure out how to parse the input syntax, then maybe you need to change it. macro_rules! recurrence { ( a[n] = $($inits:expr),+ , ... , $recur:expr ) => { /* ... */ };
}
# fn main() {} Assuming you aren't familiar with the syntax, allow me to elucidate. This is defining a macro, using the macro_rules! system, called recurrence!. This macro has a single parsing rule. That rule says the input to the macro must match: the literal token sequence a [ n ] =, a repeating (the $( ... )) sequence, using , as a separator, and one or more (+) repeats of: a valid expression captured into the metavariable inits ($inits:expr) the literal token sequence , ... ,, a valid expression captured into the metavariable recur ($recur:expr). Finally, the rule says that if the input matches this rule, then the macro invocation should be replaced by the token sequence /* ... */. It's worth noting that inits, as implied by the name, actually contains all the expressions that match in this position, not just the first or last. What's more, it captures them as a sequence as opposed to, say, irreversibly pasting them all together. Also note that you can do "zero or more" with a repetition by using * instead of + and even optional, "zero or one" with ?. There is no support for "zero or one" or more specific numbers of repetitions. As an exercise, let's take the proposed input and feed it through the rule, to see how it is processed. The "Position" column will show which part of the syntax pattern needs to be matched against next, denoted by a "⌂". Note that in some cases, there might be more than one possible "next" element to match against. "Input" will contain all of the tokens that have not been consumed yet. inits and recur will contain the contents of those bindings. Position Input inits recur a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ a[n] = 0, 1, ..., a[n-1] + a[n-2] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ [n] = 0, 1, ..., a[n-1] + a[n-2] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ n] = 0, 1, ..., a[n-1] + a[n-2] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ] = 0, 1, ..., a[n-1] + a[n-2] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ = 0, 1, ..., a[n-1] + a[n-2] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ 0, 1, ..., a[n-1] + a[n-2] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ 0, 1, ..., a[n-1] + a[n-2] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ⌂ , 1, ..., a[n-1] + a[n-2] 0 Note: there are two ⌂ here, because the next input token might match either the comma separator betweenem&gt; elements in the repetition, or the comma after the repetition. The macro system will keep track of both possibilities, until it is able to decide which one to follow. a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ⌂ 1, ..., a[n-1] + a[n-2] 0 a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ⌂ ⌂ , ..., a[n-1] + a[n-2] 0, 1 Note: the third, crossed-out marker indicates that the macro system has, as a consequence of the last token consumed, eliminated one of the previous possible branches. a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ⌂ ..., a[n-1] + a[n-2] 0, 1 a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ⌂ , a[n-1] + a[n-2] 0, 1 a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ a[n-1] + a[n-2] 0, 1 a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ 0, 1 a[n-1] + a[n-2] Note: this particular step should make it clear that a binding like $recur:expr will consume an entire expression, using the compiler's knowledge of what constitutes a valid expression. As will be noted later, you can do this for other language constructs, too. The key take-away from this is that the macro system will try to incrementally match the tokens provided as input to the macro against the provided rules. We'll come back to the "try" part. Now, let's begin writing the final, fully expanded form. For this expansion, I was looking for something like: let fib = { struct Recurrence { mem: [u64; 2], pos: usize, } This will be the actual iterator type. mem will be the memo buffer to hold the last few values so the recurrence can be computed. pos is to keep track of the value of n. Aside : I've chosen u64 as a "sufficiently large" type for the elements of this sequence. Don't worry about how this will work out for other sequences; we'll come to it. impl Iterator for Recurrence { type Item = u64; #[inline] fn next(&mut self) -> Option<Self::Item> { if self.pos < 2 { let next_val = self.mem[self.pos]; self.pos += 1; Some(next_val) We need a branch to yield the initial values of the sequence; nothing tricky. } else { let a = /* something */; let n = self.pos; let next_val = a[n-1] + a[n-2]; self.mem.TODO_shuffle_down_and_append(next_val); self.pos += 1; Some(next_val) } } } This is a bit harder; we'll come back and look at how exactly to define a. Also, TODO_shuffle_down_and_append is another placeholder; I want something that places next_val on the end of the array, shuffling the rest down by one space, dropping the 0th element. Recurrence { mem: [0, 1], pos: 0 }
