The first stage of compilation for a Rust program is tokenization . This is where the source text is transformed into a sequence of tokens ( i.e. indivisible lexical units; the programming language equivalent of "words"). Rust has various kinds of tokens, such as: Identifiers: foo, Bambous, self, we_can_dance, LaCaravane, … Literals: 42, 72u32, 0_______0, 1.0e-40, "ferris was here", … Keywords: _, fn, self, match, yield, macro, … Symbols: [, :, ::, ?, ~, @ [1] , … …among others. There are some things to note about the above: first, self is both an identifier and a keyword. In almost all cases, self is a keyword, but it is possible for it to be treated as an identifier, which will come up later (along with much cursing). Secondly, the list of keywords includes some suspicious entries such as yield and macro that aren't actually in the language, but are parsed by the compiler—these are reserved for future use. Third, the list of symbols also includes entries that aren't used by the language. In the case of <-, it is vestigial: it was removed from the grammar, but not from the lexer. As a final point, note that :: is a distinct token; it is not simply two adjacent : tokens. The same is true of all multi-character symbol tokens in Rust, as of Rust 1.2. [2] @ has a purpose, though most people seem to forget about it completely: it is used in patterns to bind a non-terminal part of the pattern to a name. Technically rust currently(1.46) has two lexers, rustc_lexer which only emits single character symbols as tokens and the lexer in rustc_parse which sees multi-character symbols as distinct tokens. As a point of comparison, it is at this stage that some languages have their macro layer, though Rust does not . For example, C/C++ macros are effectively processed at this point. [3] This is why the following code works: [4] #define SUB void
#define BEGIN {
#define END } SUB main() BEGIN printf("Oh, the horror!\n");
END In fact, the C preprocessor uses a different lexical structure to C itself, but the distinction is broadly irrelevant. Whether it should work is an entirely different question.

